import React, { Component } from 'react'
import { Text, View, Dimensions, Image } from 'react-native'
import Swiper from '../../components/Swiper'
import { TouchableOpacity } from 'react-native-gesture-handler';
import rootStore from '../../mobx/rootStore';

class OnboardingItem extends Component {
	constructor(props) {
		super(props)

		this._completeOnboarding = this._completeOnboarding.bind(this)
	}

	async _completeOnboarding() {
		await rootStore.setOnboarding(false)
		this.props.navigation.navigate('Auth')
	}

	render() {
		const { item, index, height, width } = this.props
		return (
			<View style={{
				height: height,
				width: width,
			}}>
				<View style={{
					flex: 1
				}}>
					<View style={{
						flex: 11,
						justifyContent: 'center'
					}}>
						<View style={{
							alignItems: 'center'
						}}>
							<Image style={{
								width: 240,
								height: 240
							}} source={{
								uri: item.imageUri
							}} />
						</View>
						<View style={{
							padding: 32
						}}>
							<Text style={{
								fontFamily: 'Inter-Medium',
								fontSize: 24,
								textAlign: 'center',
								color: '#7DABC9',
								paddingBottom: 8
							}}>{item.title}</Text>
							<Text style={{
								fontFamily: 'Inter-Regular',
								fontSize: 16,
								textAlign: 'center',
								color: `#777777`,
								letterSpacing: -0.3
							}}>{item.description}</Text>
						</View>
					</View>
					<View style={{
						flex: 2,
						justifyContent: 'center'
					}}>
						{
							index > 1 ? (
								<TouchableOpacity onPress={() => {
									this._completeOnboarding()
								}}>
									<Text style={{
										fontFamily: 'Inter-SemiBold',
										fontSize: 24,
										textAlign: 'center',
										color: '#7DABC9'
									}}>Get Started</Text>
								</TouchableOpacity>
							) : (
								<TouchableOpacity onPress={() => {
									this.props.toggleOnPress()
									this.props.scrollTo(index + 1)}
								}>
									<Text style={{
										fontFamily: 'Inter-SemiBold',
										fontSize: 24,
										textAlign: 'center',
										color: '#7DABC9'
									}}>Next</Text>
								</TouchableOpacity>
							)
						}
					</View>
				</View>
			</View>
		)
	}
}

export class OnboardingScreen extends Component {
	constructor(props) {
		super(props)

		const viewport = Dimensions.get('window')
		this._swiperItemHeight = viewport.height
		this._swiperItemWidth = viewport.width
		this._onboardingList = [
			{
				imageUri: `data:image/png;base64,`,
				title: 'Gain Insight',
				description: `Keep on track, you will end up right where you wanna be. Piara will help you to connect the dots between what you do and what you feel.`
			},
			{
				imageUri: `data:image/png;base64,`,
				title: 'Improve Self Awareness',
				description: `Within seconds, update your mood and activities daily. Piara will analyze it to understand your emotions better.`
			},
			{
				imageUri: `data:image/png;base64,`,
				title: 'Privacy First',
				description: `Piara values your privacy by using blockchain-based tech with decentralized encrypted cloud storage provided by Blockstack. Piara doesn’t have access to your data, let alone sell it. Piara #CantBeEvil! `
			},
		]
	}
	
	render() {
		return (
			<View style={{
				flex: 1
			}}>
				<Swiper
					itemWidth={this._swiperItemWidth}
					firstItem={0}
				>
					{
						this._onboardingList.map((item, index) => {
							return (
								<OnboardingItem 
									item={item} 
									index={index} 
									height={this._swiperItemHeight} 
									width={this._swiperItemWidth} 
									key={index}
									navigation={this.props.navigation}
								/>
							)
						})
					}
				</Swiper>
			</View>
		)
	}
}

export default OnboardingScreen
